class User {
public:
    vector<int> likes;
    int id;
    string TIE;
    User(int id, vector<int> likes, string TIE) {
        this->likes = likes;
        this->id = id;
        this->TIE = TIE;
    }

};

class Lecture {
public:
    int id;
    int capacity;
    Lecture(int id, int capacity) {
        this->id = id;
        this->capacity = capacity;
    }
};

class Block {
public:
    int id;
    vector<Lecture> lectures;
    int type; //0 - normal, 1 - sluzba
    Block(int id, vector<Lecture> lectures, int type) {
        this->id = id;
        this->lectures = lectures;
        this->type = type;
    }
};

class RGroup {
public:
    int id;
    vector<User*> users;
    RGroup(int id, vector<User*> users) {
        this->id = id;
        this->users = users;
    }

};


